    let [transportContext,setTransportContext] = useContext(TransportContext)
    console.log(props.data)
    const transportOptions = [
        {
          url: 'https://c4.wallpaperflare.com/wallpaper/905/654/385/5bd31e1f538c0-wallpaper-preview.jpg',
          mode: 'Cabs',
          averageBudget: 2000
        },
        {
          url: 'https://c4.wallpaperflare.com/wallpaper/905/654/385/5bd31e1f538c0-wallpaper-preview.jpg',
          mode: 'Railways',
          averageBudget: 2000
        },
        {
          url: 'https://c4.wallpaperflare.com/wallpaper/905/654/385/5bd31e1f538c0-wallpaper-preview.jpg',
          mode: 'Airways',
          averageBudget: 2000
        },
        {
          url: 'https://c4.wallpaperflare.com/wallpaper/905/654/385/5bd31e1f538c0-wallpaper-preview.jpg',
          mode: 'Waterways',
          averageBudget: 2000
        },
        {
          url: 'https://c4.wallpaperflare.com/wallpaper/905/654/385/5bd31e1f538c0-wallpaper-preview.jpg',
          mode: 'MiniBus',
          averageBudget: 2000
        },
        {
          url: 'https://c4.wallpaperflare.com/wallpaper/905/654/385/5bd31e1f538c0-wallpaper-preview.jpg',
          mode: 'Bus',
          averageBudget: 2000
        }
      ];
      
      function TransportOptions() {
        const handleBooking = (mode) => {
          // Handle booking based on the mode
          console.log(`Booking ${mode}`);
        };
      
        return (
          <div className="flex flex-wrap justify-center">
            {transportOptions.map((option, index) => {                
           

              <div key={index} className="w-[300px] rounded-lg overflow-hidden shadow-xl m-2">
                <div className='overflow-hidden object-cover' >
                  <img className="w-full h-40 transform origin-center transition-transform duration-400 object-cover hover:scale-110" src={option.url} alt="Your Image" />
                </div>
                <div className="px-6 py-4">
                  <div className="font-bold text-xl mb-2">{option.mode}</div>
                  <p className="text-gray-700 truncate">(Average Budget: {option.averageBudget})</p>
                  <button onClick={() => handleBooking(option.mode)} className='rounded-full bg-sky-600 p-3 text-white my-2'>View Options</button>
                </div>
              </div>
           
      }
            )}
          </div>
        );
      }
   
  
}

export default TransportChild
